        internal static void GammaSpeedTest()
        {
            Stopwatch watch = new Stopwatch();
            MMath.GammaLn(0.1);
            MMath.GammaLn(3);
            MMath.GammaLn(20);
            for (int i = 0; i < 100; i++)
            {
                double x = (i + 1) * 0.1;
                watch.Restart();
                for (int trial = 0; trial < 1000; trial++)
                {
                    MMath.GammaLn(x);
                }
                watch.Stop();
                Console.WriteLine($"{x} {watch.ElapsedTicks}");
            }
        }

