        [Fact]
        public void NormalCdfRatioTest()
        {
            double r0 = MMath.Sqrt2PI / 2;
            Assert.Equal(r0, MMath.NormalCdfRatio(0));
            Assert.Equal(r0, MMath.NormalCdfRatio(6.6243372842224754E-170));
            Assert.Equal(r0, MMath.NormalCdfRatio(-6.6243372842224754E-170));
        }

