        public static double NormalCdfMomentRatioTaylorZero(int n, double x)
        {
            double sum = 0;
            double Reven = MMath.Sqrt2PI / 2;
            double Rodd = 1;
            if (n % 2 == 0)
            {
                // Reven = (1*3*...*(n-1))/n! = 1/(2*4*...*n)
                // Rodd = (2*4*...*n)/n! = 1/(1*3*...*(n-1))
                int h = n / 2;
                for (int i = 0; i < h; i++)
                {
                    Reven /= 2 * (i + 1);
                    Rodd /= 2 * i + 1;
                }
                Rodd *= x;
            }
            else
            {
                // Reven = (1*3*...*n)/n! = 1/(2*4*...*(n-1)) 
                // Rodd = (2*4*...*(n-1))/n! = 1/(1*3*...*n)
                int h = (n - 1) / 2;
                for (int i = 0; i < h; i++)
                {
                    Reven /= 2 * (i + 1);
                    Rodd /= 2 * i + 3;
                }
                Reven *= x;
            }
            double x2 = x * x;
            double sumOld = 0;
            for (int i = 0; i < 100; i++)
            {
                if ((i + n) % 2 == 0)
                {
                    sum += Reven;
                    Reven *= x2 * (i + n + 1) / ((i + 1) * (i + 2));
                }
                else
                {
                    sum += Rodd;
                    Rodd *= x2 * (i + n + 1) / ((i + 1) * (i + 2));
                }
                if (sum == sumOld)
                {
                    Console.WriteLine("{0} terms", i);
                    break;
                }
                sumOld = sum;
            }
            return sum;
        }

