        public static int NormalCdfMomentRatioConFracCount(int n, double x)
        {
            if (x >= 0)
                throw new ArgumentException("x >= 0", nameof(x));
            double invX = 1 / x;
            double invX2 = invX * invX;
            double numer = -invX;
            double numerPrev = 0;
            double denom = 1;
            double denomPrev = 1;
            double a = invX2;
            for (int i = 1; i <= n; i++)
            {
                numer *= -invX;
                double denomNew = denom + a * denomPrev;
                a += invX2;
                denomPrev = denom;
                denom = denomNew;
            }
            double rprev = 0;
            for (int i = 0; i < 1000; i++)
            {
                double numerNew = numer + a * numerPrev;
                double denomNew = denom + a * denomPrev;
                a += invX2;
                numerPrev = numer;
                numer = numerNew;
                denomPrev = denom;
                denom = denomNew;
                double r = numer / denom;
                if (r == rprev)
                    return i;
                rprev = r;
            }
            return Int32.MaxValue;
        }

        public static int NormalCdfRatioConFracCount(double x, double expected)
        {
            Assert.True(x < 0);
            double invX = 1 / x;
            double invX2 = invX * invX;
            // Continued fraction approach
            // can also be used for x > -6, but prohibitively many terms would be required.
            double numer = -invX;
            double numerPrev = 0;
            double denom = 1;
            double denomPrev = 1;
            double a = invX2;
            double rprev = 0;
            for (int i = 1; i < 100; i++)
            {
                double numerNew = numer + a * numerPrev;
                double denomNew = denom + a * denomPrev;
                a += invX2;
                numerPrev = numer;
                numer = numerNew;
                denomPrev = denom;
                denom = denomNew;
                double r = numer / denom;
                if (r == expected)
                    return i;
                if (r == rprev)
                    return i;
                rprev = r;
            }
            Console.WriteLine("actual = {0} expected = {1}", numer / denom, expected);
            return 50;
        }

